// src/components/Home.js
import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";

const Home = () => {
  const [employees, setEmployees] = useState([]);
  const [searchId, setSearchId] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    fetchEmployees();
  }, []);

  const fetchEmployees = async () => {
    try {
      const response = await axios.get(
        "https://669b3f09276e45187d34eb4e.mockapi.io/api/v1/employee"
      );
      setEmployees(response.data);
    } catch (error) {
      console.error("Error fetching employees", error);
    }
  };

  const handleSearch = async () => {
    if (searchId) {
      try {
        const response = await axios.get(`https://669b3f09276e45187d34eb4e.mockapi.io/api/v1/employee/${searchId}`);
        setEmployees([response.data]);
      } catch (error) {
        console.error("Error searching employee", error);
      }
    } else {
      fetchEmployees();
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`https://669b3f09276e45187d34eb4e.mockapi.io/api/v1/employee/${id}`);
      fetchEmployees();
    } catch (error) {
      console.error("Error deleting employee", error);
    }
  };

  return (
    <div>
      <h1>Employee List</h1>
      <input
        type="text"
        placeholder="Search by ID"
        value={searchId}
        onChange={(e) => setSearchId(e.target.value)}
      />
      <button onClick={handleSearch}>Search</button>
      <Link to="/add">
        <button>Add Employee</button>
      </Link>
      <table className="table">
  <thead>
    <tr>
      <th>Avatar</th>
      <th>Name</th>
      <th>Email</th>
      <th>Mobile</th>
      <th>Country</th>
      <th>State</th>
      <th>District</th>
      <th>Actions</th>
    </tr>
  </thead>
  <tbody>
    {employees.map((employee) => (
      <tr key={employee.id}>
        <td>
          <img
            src={employee.avatar}
            alt={employee.name}
            className="img-fluid rounded-circle"
            style={{ width: '50px', height: '50px' }}
          />
        </td>
        <td>{employee.name}</td>
        <td>{employee.emailId}</td>
        <td>{employee.mobile}</td>
        <td>{employee.country}</td>
        <td>{employee.state}</td>
        <td>{employee.district}</td>
        <td>
          <Link to={`/edit/${employee.id}`}>
            <button className="btn btn-primary me-2">Edit</button>
          </Link>
          <button className="btn btn-danger" onClick={() => handleDelete(employee.id)}>
            Delete
          </button>
        </td>
      </tr>
    ))}
  </tbody>
</table>


    </div>
  );
};

export default Home;
